import React from "react";
import ReactDOM, { render } from "react-dom";
import "./index.scss";

class Header extends React.Component {
  render() {
    return (
      <nav className="header">
        <ul>
          <li>
            <a>Site name</a>
          </li>
          <li>
            <a>Log out</a>
          </li>
          <li>
            <svg height="60" width="60">
              <circle
                cx="30"
                cy="30"
                r="20"
                stroke="black"
                stroke-width="3"
                fill="red"
                padding="0"
              />
            </svg>
          </li>
        </ul>
      </nav>
    );
  }
}

class Content extends React.Component {
  render() {
    return (
      <div className="content">
        <Menu />
        <List />
      </div>
    );
  }
}

class Menu extends React.Component {
  render() {
    return (
      <div className="menu-container">
        <h1 className="menu-head"> Explore </h1>
        <h1 className="menu-head"> My work </h1>
        <h3 className="menu-subhead"> Notebooks</h3>
        <h3 className="menu-subhead"> Datasets</h3>
        <h3 className="menu-subhead"> Charts</h3>
      </div>
    );
  }
}

class List extends React.Component {
  render() {
    return (
      <div className="list-container">
        <div className="list-header">
          <h1>Notebooks</h1>
        </div>
        <ItemContainer />
        <ItemContainer />
        <ItemContainer />
        <ItemContainer />
      </div>
    );
  }
}

class ItemContainer extends React.Component {
  render() {
    return (
      <div className="list-item">
        <div className="item-contents-row-one">
          <h3>Adam's Notebook</h3>
          <button className="edit-button wrap">Edit</button>
        </div>
        <div className="item-contents-row-two">
          <p>Last edited</p>
          <p>Yesterday</p>
        </div>
      </div>
    );
  }
}

class Container extends React.Component {
  render() {
    return (
      <div>
        <Header />
        <Content />
      </div>
    );
  }
}

ReactDOM.render(<Container />, document.getElementById("root"));
